import React from 'react';
class ShoppingList extends React.Component {
constructor(props) {
super(props);
this.state = {
value: 30,
};
}
render() {
console.log(this.state.name);

return (
<div className="shopping-list">
<h1 >Shopping List for </h1>

<button>ADD</button>
<ul>
<li>Instagram</li>
<li>WhatsApp</li>

<li >Oculus</li>
</ul>

</div>

);
}
}
export default ShoppingList;
